export class HoverRangeAnchor{constructor(t,r,e,i){this.priority=t,this.range=r,this.initialMousePosX=e,this.initialMousePosY=i,this.type=1}equals(t){return 1===t.type&&this.range.equalsRange(t.range)}canAdoptVisibleHover(t,r){return 1===t.type&&r.lineNumber===this.range.startLineNumber}}export class HoverForeignElementAnchor{constructor(t,r,e,i,s,n){this.priority=t,this.owner=r,this.range=e,this.initialMousePosX=i,this.initialMousePosY=s,this.supportsMarkerHover=n,this.type=2}equals(t){return 2===t.type&&this.owner===t.owner}canAdoptVisibleHover(t,r){return 2===t.type&&this.owner===t.owner}}export const HoverParticipantRegistry=new class{constructor(){this._participants=[]}register(t){this._participants.push(t)}getAll(){return this._participants}};